/* CUSTOM EVENT POLYFILL - IE*/
(function () {
    function CustomEvent(event, params) {
        params = params || { bubbles: false, cancelable: false, detail: undefined };
        var evt = document.createEvent('CustomEvent');
        evt.initCustomEvent(event, params.bubbles, params.cancelable, params.detail);
        return evt;
    }

    CustomEvent.prototype = window.Event.prototype;

    window.CustomEvent = CustomEvent;
})();



/* ACTIVE GRAPH POLYFILL */
(function () {
    function ActiveGraph() {
        this.collection = [];
        this.editorOpen = false;
        this.previewOpen = false;
        this.getCollection = function () {
            return this.collection;
        }
        this.loadCollection = function (data) {
            this.collection = data;
        }
        this.changeCollection = function (data) {
            this.collection = data;
            var event = new CustomEvent('ng-activegraph-change-collection', { bubbles: true, cancelable: true, detail: { 'collection': data } });
            document.dispatchEvent(event);
        }
    }
    window.ActiveGraph = new ActiveGraph();
})();

