// innergraph directive

(function () {
    "use strict";

    var innerDirective = function ($rootScope, ColumnService) {
        return {
            template: "<div src='getTemplateUrl()' ng-include style='height: 100%;width:100%;'></div>",
            scope: {
                modelflag: "=",
                initialData: "="
            },
            replace: true,
            restrict: "AE",
            link: function ($scope) {
                //function used on the ng-include to resolve the template
                $scope.getTemplateUrl = function () {
                    if ($scope.modelflag == "component")
                        return "templates/active-graph/component.html";
                    if ($scope.modelflag == "connection")
                        return "templates/active-graph/connection.html";
                    if ($scope.modelflag == "preview")
                        return "templates/active-graph/export.html";
                    if ($scope.modelflag == "datasource")
                        return "templates/active-graph/datasource.html";
                }
                if (typeof $scope.initialData !== 'undefined' && $scope.initialData.length > 0) {
                    ColumnService.columns = $scope.initialData;
                    var tempArr = [];
                    _.each(ColumnService.columns, function (col, i1) {
                        _.each(col.Items, function (row, i2) {
                            tempArr.push(row);
                        });
                    });
                    ColumnService.addselectedNodes = tempArr;
                }
            }
        }
    };

    angular
        .module("ngActiveGraph")
        .directive("innerGraph", ["$rootScope", "ColumnService", innerDirective]);

})();

// JSON editor directive

(function () {
    "use strict";

    var jsonDirective = function (ColumnService, JSONEditor, $timeout) {
        return {
            replace: true,
            scope: {
                onChange: '&',
                jsonData: '=',
                options: '='
            },
            compile: function (elem, attrs) {

                var link = function (scope, elem, attrs) {
                    var options = {
                        mode: 'tree',
                        // modes: ['tree', 'code'],
                        change: changedJSONFun
                    };
                    options = angular.extend(options, scope.options);
                    var editor = new JSONEditor(elem[0], options);

                    // set json
                    scope.$watch("jsonData", function (json) {
                        editor.set(json);
                    });

                    function changedJSONFun() {
                        $timeout(function () {
                            try {
                                // get json
                                var json = editor.get();
                                scope.onChange({ json: json });
                            }
                            catch (err) {
                                var json = editor.getText();
                                scope.onChange({ json: json });
                            }
                        });
                    };
                };
                return link;
            },
            template: '<div style="width: 100%; height: 100%;"></div>'
        }
    };

    angular
        .module("ngActiveGraph")
        .provider('JSONEditor', function () {
            var configuration = {
                defaults: {
                    options: {
                        indentation: 2,
                        search: false,
                        name: 'Activegraph',
                        mode: 'code'
                    }
                }
            };

            this.configure = function (options) {
                extendDeep(configuration, options);
            };

            this.$get = ['$window', function ($window) {
                // configure JSONEditor using provider's configuration
                var JSONEditor = $window.JSONEditor;
                extendDeep(JSONEditor, configuration);
                return $window.JSONEditor;
            }];

            // Helper method for merging configuration objects
            function extendDeep(dst) {
                angular.forEach(arguments, function (obj) {
                    if (obj !== dst) {
                        angular.forEach(obj, function (value, key) {
                            if (dst[key] && dst[key].constructor && dst[key].constructor === Object) {
                                extendDeep(dst[key], value);
                            } else {
                                dst[key] = value;
                            }
                        });
                    }
                });
                return dst;
            }

        })
        .directive("jsonEditor", ["ColumnService", "JSONEditor", "$timeout", jsonDirective]);

})();

// Draw Lines Directive

(function () {
    "use strict";

    //find relative position of circles   
    var drawLines = function (fromRow) {
        var lineArray = [];
        var offset1 = $("#" + fromRow.ColumnId + '-' + fromRow.Id + "-right").offsetRelative("div.item-parent");
        angular.forEach(fromRow.Links, function (d, i) {
            var line = {};
            var id = d.split(".")[1];
            var offset2 = $("#" + d.split(".")[0] + '-' + id + "-left").offsetRelative("div.item-parent");
            line.fromId = fromRow.ColumnId + '.' + fromRow.Id;
            line.toId = d.split(".")[0] + '.' + id;
            line.x1 = offset1.left + 15;
            line.y1 = offset1.top + 15;
            line.x2 = offset2.left + 15;
            line.y2 = offset2.top + 15;
            line.active = false;
            line.inactive = false;
            line.color = '#353535';
            line.width = 2;
            line.Id = "line-" + fromRow.ColumnId + '.' + fromRow.Id + d;
            line.rId = "line-" + d + fromRow.ColumnId + '.' + fromRow.Id;
            line.marked = false;
            lineArray.push(line);
        });
        return lineArray;
    }

    var draw = function (ColumnService) {
        _.each(ColumnService.lineData, function (line, index) {
            var lines = drawLines(line);
            _.each(lines, function (item, index) {
                if (ColumnService.lineArray.length == 0) {
                    ColumnService.lineArray.push(item);
                }
                else if (ColumnService.lineArray.length > 0 && _.findIndex(ColumnService.lineArray, { Id: item.Id }) == -1) {
                    ColumnService.lineArray.push(item);
                }
            });
        });
        return ColumnService.lineArray;
    }

    var directive = function ($rootScope, $timeout, ColumnService) {
        return {
            restrict: "EA",
            replace: true,
            scope: {
                data: '='
            },
            compile: function ($element, $attrs) {

                var link = function ($scope, $element, $attrs, $ctrls) {
                    $scope.$on("line-data-change", function () {
                        console.log("line-data-change")
                        $timeout(function () {
                            $scope.lineArray = draw(ColumnService);
                        }, 10);
                    });

                    $scope.$on("redraw-data-change", function () {
                        console.log("redraw-data-change")
                        $timeout(function () {
                            $scope.lineArray = draw(ColumnService);
                        }, 10);
                    });

                    $scope.$on("delete-lines", function () {
                        console.log("delete-lines")
                        $timeout(function () {
                            $scope.lineArray = ColumnService.lineArray;
                        }, 10);
                    });

                    ColumnService.redraw();

                    //$timeout(function () {
                    //    var width = ColumnService.columns.length * 480;
                    //    $(".svg-holder").width(width);
                    //    var height = $(".column-content1").height();
                    //    $(".svg-holder").height(height);
                    //}, 10);

                    $scope.selectLine = function (line) {
                        if (ColumnService.selectedLines.length == 0) {
                            ColumnService.selectedLines.push(line);
                            line.color = 'orange';
                            line.width = '3';
                        }
                        else {
                            var index = _.findIndex(ColumnService.selectedLines, { Id: line.Id });
                            if (index == -1) {
                                ColumnService.selectedLines.push(line);
                                line.color = 'orange';
                                line.width = '3';
                            }
                            else {
                                line.color = '#353535';
                                line.width = '2';
                                ColumnService.selectedLines.splice(index, 1);
                            }
                        }
                    };
                };
                return link;
            },
            templateUrl: 'templates/active-graph/lines.tmpl.html'
        }
    };
    angular
        .module("ngActiveGraph")
        .directive("drawLines", ['$rootScope', '$timeout', 'ColumnService', directive]);

})();

// Range directive

(function () {
    "use strict";

    var rangeDirective = function () {
        return {
            restrict: "EA",
            scope: {
                bordernumber: '=',
                setBorderWidth: '&'
            },
            compile: function ($element, $attrs) {
                var link = function ($scope, $element, $attrs, $ctrls) {
                    $scope.bordernumber = parseInt($scope.bordernumber) || 0; //set initial border width 
                    $scope.borderFlag = true; //borderbottom & top flag
                    // border range function
                    $scope.getBorder = function (sign) {
                        if ($scope.bordernumber >= 0) {
                            if (sign == 'down') {
                                $scope.borderFlag = true;
                                $scope.bordernumber = parseInt($scope.bordernumber) + 1;
                                $scope.setBorderWidth({ width: $scope.bordernumber });
                            } else {
                                if ($scope.bordernumber > 0) {
                                    $scope.borderFlag = false;
                                    $scope.bordernumber = parseInt($scope.bordernumber) - 1;
                                    $scope.setBorderWidth({ width: $scope.bordernumber });
                                }
                            }
                        }
                    }
                };
                return link;
            },
            templateUrl: 'templates/active-graph/range.tmpl.html'
        }
    };
    angular
        .module("ngActiveGraph")
        .directive("range", [rangeDirective]);

})();

