// ngActivegraphPreview directive

(function () {
    "use strict";

    var directive = function ($window, $timeout, $rootScope, $broadcastFactory) {
        return {
            restrict: "EA",
            scope: {
                data: "=",
                wrap: "=",
                config: "=",
            },

            compile: function ($element, $attrs, $ctrls) {

                var link = function ($scope, $element, $attrs, $ctrls) {
                    $scope.columnNames = [];
                    $scope.activeGraphview = { 'show': false };
                    $scope.rightSidePane = { visible: false };
                    $scope.bottomSidePane = { visible: false, paneNode: null };
                    $scope.markIntersectedPathsOnly = false;
                    $scope.itemParentID = 'container_' + Date.now();


                    $(window).bind('resize', function () {
                        console.log('resize');
                        resizeColumns();
                    });

                    function resizeColumns() {
                        var _container = document.getElementById($scope.itemParentID);
                        if (_container) {
                            var _props = _container.getBoundingClientRect();
                            if (_props.width > 650 && _props.width < 1080) {
                                var _columnWidth = 300;
                                var _noOfColumns = Math.floor(_props.width / _columnWidth);
                                if (_noOfColumns >= 2) {
                                    var _marginRight = _props.width - (_noOfColumns * _columnWidth);                                    
                                    if (_marginRight < 15)
                                        _marginRight = 15;
                                    else {
                                        _marginRight = (_marginRight / 2) - 5;
                                    }
                                    var _elements = document.querySelectorAll('#' + $scope.itemParentID + ' .col-width.wrapped');
                                    if (_elements && _elements.length > 0) {
                                        for (var i = 0; i < _elements.length; i++) {
                                            _elements[i].style.marginRight = _marginRight + 'px';
                                        }
                                    }
                                }
                            }
                            else if (_props.width > 500 && _props.width < 650) {
                                var _marginRight = 20;
                                var _width = (_props.width - 40) * 0.47;
                                var _elements = document.querySelectorAll('#' + $scope.itemParentID + ' .col-width.wrapped');
                                if (_elements && _elements.length > 0) {
                                    for (var i = 0; i < _elements.length; i++) {
                                        _elements[i].style.marginRight = _marginRight + 'px';
                                        _elements[i].style.width = _width + 'px';
                                    }
                                }
                                var _columNames = document.querySelectorAll('#' + $scope.itemParentID + ' .col-width.wrapped .columnName');
                                if (_columNames && _columNames.length > 0) {
                                    for (var i = 0; i < _columNames.length; i++) {
                                        _columNames[i].style.width = _width + 'px';
                                    }
                                }
                                var _nodes = document.querySelectorAll('#' + $scope.itemParentID + ' .col-width.wrapped .node-rect');
                                if (_nodes && _nodes.length > 0) {
                                    for (var i = 0; i < _nodes.length; i++) {
                                        _nodes[i].style.width = _width + 'px';
                                    }
                                }
                            }
                            else if (_props.width < 500) {
                                var _width = (_props.width - 30);
                                var _elements = document.querySelectorAll('#' + $scope.itemParentID + ' .col-width.wrapped');
                                if (_elements && _elements.length > 0) {
                                    for (var i = 0; i < _elements.length; i++) {                                        
                                        _elements[i].style.width = _width + 'px';
                                    }
                                }
                                var _columNames = document.querySelectorAll('#' + $scope.itemParentID + ' .col-width.wrapped .columnName');
                                if (_columNames && _columNames.length > 0) {
                                    for (var i = 0; i < _columNames.length; i++) {
                                        _columNames[i].style.width = _width + 'px';
                                    }
                                }
                                var _nodes = document.querySelectorAll('#' + $scope.itemParentID + ' .col-width.wrapped .node-rect');
                                if (_nodes && _nodes.length > 0) {
                                    for (var i = 0; i < _nodes.length; i++) {
                                        _nodes[i].style.width = _width + 'px';
                                    }
                                }
                            }
                        }
                    }

                    $rootScope.reInit = function () {
                        //$rootScope.resetZoom();
                        angular.forEach($scope.data, function (item, key) {
                            $scope.columnNames.push({ 'Name': item.Name, 'Meta': item.Meta });
                            angular.forEach(item.Items, function (value, index) {
                                value.active = false;
                                value.inactive = false;
                                value.rAnchorActive = false;
                                value.rAnchorInActive = false;
                                value.lAnchorActive = false;
                                value.lAnchorInActive = false;
                            });
                        });
                        $scope.columns = $scope.data;
                        $timeout(function () {
                            resizeColumns();
                        }, 100);
                        if (typeof $scope.wrap !== 'undefined' && $scope.wrap == true)
                            return;
                        $scope.relationships = [];
                        angular.forEach($scope.data, function (columnItem, iterval) {
                            angular.forEach(columnItem.Items, function (rowItem, rowIterVal) {
                                rowItem.ColumnId = columnItem.Id;
                                rowItem.ColumnIndex = iterval;
                                angular.forEach(rowItem.Links, function (link) {
                                    var linkItemColumn = link.split(".")[0];
                                    var linkItemRow = link.split(".")[1];
                                    var obj = { 'fromNode': columnItem.Id + '.' + rowItem.Id, 'toNode': link, 'typeIsForward': true, 'traversed': false, 'fromColumn': columnItem.Id, 'toColumn': linkItemColumn };
                                    $scope.relationships.push(obj);
                                    var obj = { 'fromNode': link, 'toNode': columnItem.Id + '.' + rowItem.Id, 'typeIsForward': false, 'traversed': false, 'fromColumn': columnItem.Id, 'toColumn': linkItemColumn };
                                    $scope.relationships.push(obj);
                                });
                            });
                        });
                        setTimeout(function () {
                            $scope.$apply(function () {
                                $scope.lineArray = drawLines($scope.columns);
                            });
                        }, 10);
                        $scope.bottomSidePane = { visible: false, paneNode: null };
                    }

                    $scope.config.reInit = $rootScope.reInit;
                    $scope.config.nodeContextMarkUpNodes = function (data) {
                        var _result = [];
                        angular.forEach($scope.data, function (columnItem, iterval) {
                            angular.forEach(columnItem.Items, function (rowItem, rowIterVal) {
                                var _mark = false;
                                for (var i = 0; i < data.length; i++) {
                                    if ((columnItem.Id + '.' + rowItem.Id).localeCompare(data[i].ColumnId + '.' + data[i].Id) == 0) {
                                        _mark = true;
                                        _result.push(rowItem);
                                        break;
                                    }
                                }
                                rowItem.active = _mark;
                            });
                        });
                        return _result;
                    }

                    $rootScope.reInit();

                    $scope.markSingleNode = function (id) {
                        angular.forEach($scope.data, function (columnItem) {
                            angular.forEach(columnItem.Items, function (rowItem) {
                                var mid = columnItem.Id + '.' + rowItem.Id;
                                if (mid.localeCompare(id) == 0) {
                                    rowItem.active = true;
                                    rowItem.inactive = false;
                                    rowItem.rAnchorActive = false;
                                    rowItem.rAnchorInActive = true;
                                    rowItem.lAnchorActive = false;
                                    rowItem.lAnchorInActive = true;
                                }
                            });
                        });
                    }

                    $scope.markSingleNodeOnlyActive = function (id) {
                        $scope.resetNodes();
                        angular.forEach($scope.data, function (columnItem) {
                            angular.forEach(columnItem.Items, function (rowItem) {
                                var mid = columnItem.Id + '.' + rowItem.Id;
                                if (mid.localeCompare(id) == 0) {
                                    rowItem.active = true;
                                    rowItem.inactive = false;
                                    rowItem.rAnchorActive = false;
                                    rowItem.rAnchorInActive = true;
                                    rowItem.lAnchorActive = false;
                                    rowItem.lAnchorInActive = true;
                                }
                            });
                        });
                    }

                    $scope.markPath = function (from, to, typeIsForward) {
                        if (typeIsForward) {
                            angular.forEach($scope.data, function (columnItem) {
                                angular.forEach(columnItem.Items, function (rowItem) {
                                    var mid = columnItem.Id + '.' + rowItem.Id;
                                    if (mid.localeCompare(from) == 0) {
                                        rowItem.active = true;
                                        rowItem.inactive = false;
                                        rowItem.rAnchorActive = true;
                                        rowItem.rAnchorInActive = false;
                                    }
                                    else if (mid.localeCompare(to) == 0) {
                                        rowItem.active = true;
                                        rowItem.inactive = false;
                                        rowItem.lAnchorActive = true;
                                        rowItem.lAnchorInActive = false;
                                    }
                                });
                            });
                            angular.forEach($scope.lineArray, function (line) {
                                if (line.Id.localeCompare('line-' + from + to) == 0 && line.marked == false) {
                                    line.active = true;
                                    line.inactive = false;
                                    line.marked = true;
                                }
                            });
                        }
                        else {
                            angular.forEach($scope.data, function (columnItem) {
                                angular.forEach(columnItem.Items, function (rowItem) {
                                    var mid = columnItem.Id + '.' + rowItem.Id;
                                    if (mid.localeCompare(from) == 0) {
                                        rowItem.active = true;
                                        rowItem.inactive = false;
                                        rowItem.lAnchorActive = true;
                                        rowItem.lAnchorInActive = false;
                                    }
                                    else if (mid.localeCompare(to) == 0) {
                                        rowItem.active = true;
                                        rowItem.inactive = false;
                                        rowItem.rAnchorActive = true;
                                        rowItem.rAnchorInActive = false;
                                    }
                                });
                            });
                            angular.forEach($scope.lineArray, function (line) {
                                if (line.rId.localeCompare('line-' + from + to) == 0 && line.marked == false) {
                                    line.active = true;
                                    line.inactive = false;
                                    line.marked = true;
                                }
                            });
                        }
                    }

                    $scope.goForward = function (from, to, rels) {
                        $scope.markPath(from, to, true);
                        _.each(
                            _.filter(rels, function (e) {
                                return e.fromNode.localeCompare(from) == 0 && e.toNode.localeCompare(to) == 0 && e.typeIsForward == true && e.traversed == false
                            }), function (i) {
                                i.traversed = true;
                            });
                        var fwdRelationships = _.filter(rels, function (rel) {
                            return to.localeCompare(rel.fromNode) == 0 && rel.typeIsForward == true && rel.traversed == false
                        });
                        if (fwdRelationships.length > 0) {
                            _.each(fwdRelationships, function (fwdRel) {
                                $scope.goForward(fwdRel.fromNode, fwdRel.toNode, rels);
                            });
                        }
                        else return;
                    }

                    $scope.goBackWard = function (from, to, rels) {
                        $scope.markPath(from, to, false);
                        _.each(
                            _.filter(rels, function (e) {
                                return e.fromNode.localeCompare(from) == 0 && e.toNode.localeCompare(to) == 0 && e.typeIsForward == false && e.traversed == false
                            }), function (i) {
                                i.traversed = true;
                            });
                        var bwdRelationships = _.filter(rels, function (rel) {
                            return to.localeCompare(rel.fromNode) == 0 && rel.typeIsForward == false && rel.traversed == false
                        });
                        if (bwdRelationships.length > 0) {
                            _.each(bwdRelationships, function (bwdRel) {
                                $scope.goBackWard(bwdRel.fromNode, bwdRel.toNode, rels);
                            });
                        }
                        else return;
                    }

                    $scope.markAllBackWards = function (node) {
                        var relToId = node.ColumnId + '.' + node.Id;
                        var linkings = angular.copy($scope.relationships);
                        var bwdRelationships = _.filter(linkings, function (rel) {
                            return relToId.localeCompare(rel.fromNode) == 0 && rel.typeIsForward == false
                        });
                        if (bwdRelationships.length > 0) {
                            _.each(bwdRelationships, function (bwdRel) {
                                $scope.goBackWard(bwdRel.fromNode, bwdRel.toNode, linkings);
                            });
                        }
                    }

                    $scope.markAllForwards = function (node) {
                        var relToId = node.ColumnId + '.' + node.Id;
                        var linkings = angular.copy($scope.relationships);
                        var fwdRelationships = _.filter(linkings, function (rel) {
                            return relToId.localeCompare(rel.fromNode) == 0 && rel.typeIsForward == true
                        });
                        if (fwdRelationships.length > 0) {
                            _.each(fwdRelationships, function (fwdRel) {
                                $scope.goForward(fwdRel.fromNode, fwdRel.toNode, linkings);
                            });
                        }
                    }

                    //$scope.$watch('markIntersectedPathsOnly', function (newValue) {
                    //console.log(newValue);
                    //});


                    $scope.resetNodes = function () {
                        angular.forEach($scope.data, function (columnItem) {
                            angular.forEach(columnItem.Items, function (rowItem) {
                                rowItem.active = false;
                                rowItem.inactive = true;
                                rowItem.lAnchorActive = false;
                                rowItem.lAnchorInActive = true;
                                rowItem.rAnchorActive = false;
                                rowItem.rAnchorInActive = true;
                            });
                        });
                        angular.forEach($scope.lineArray, function (line) {
                            line.active = false;
                            line.inactive = true;
                            line.marked = false;
                        });
                    }

                    $scope.selectedLinks = [];
                    $scope.selectedNodes = [];

                    $scope.nodeSelect = function (node, index, event, forceFwd, forceBwd, ignoreCtrl, dontReset) {
                        if (dontReset == false)
                            $scope.resetNodes();
                        if (ignoreCtrl == true || (event.ctrlKey == false && ignoreCtrl == false)) {
                            $scope.selectedNodes = [];
                            $scope.pushNode(node);
                            var pathFwdOnly = false;
                            var pathBwdOnly = false;
                            if (ignoreCtrl == false) {
                                if (index == 0)
                                    pathFwdOnly = true;
                                else if (index == $scope.data.length - 1)
                                    pathBwdOnly = true;
                                else {
                                    pathBwdOnly = true;
                                    pathFwdOnly = true;
                                }
                            }
                            if ((pathFwdOnly == true && ignoreCtrl == false) || (forceFwd == true && ignoreCtrl == true)) {
                                $scope.markAllForwards(node);
                            }
                            if ((pathBwdOnly == true && ignoreCtrl == false) || (forceBwd == true && ignoreCtrl == true)) {
                                $scope.markAllBackWards(node)
                            }
                        }
                        else {
                            $scope.pushNode(node);
                            console.log($scope.selectedNodes);
                            if ($scope.selectedNodes.length == 1) {
                                var n = $scope.selectedNodes[0];
                                $scope.markSingleNode(n.ColumnId + '.' + n.Id);
                            }
                            else {
                                $scope.selectedNodes = _.sortBy($scope.selectedNodes, 'ColumnIndex');
                                var lastIndex = $scope.selectedNodes.length - 1;
                                var linkings = angular.copy($scope.relationships);
                                var result = false;
                                angular.forEach($scope.selectedNodes, function (n, i) {
                                    if (i == 0 || (i <= $scope.selectedNodes.length - 2 && result)) {
                                        result = $scope.findPathsIntersections($scope.selectedNodes[i], $scope.selectedNodes[i + 1], linkings);
                                    }
                                });
                                if (result) {
                                    if (!$scope.markIntersectedPathsOnly) {
                                        var selNodes = angular.copy($scope.selectedNodes);
                                        selNodes.sort(function (a, b) {
                                            if (a.ColumnId.localeCompare(b.ColumnId) == 0)
                                                return a.Id.localeCompare(b.Id);
                                            else
                                                return a.ColumnId.localeCompare(b.ColumnId);
                                        });
                                        $scope.markAllBackWards(selNodes[0]);
                                        $scope.markAllForwards(selNodes[selNodes.length - 1]);
                                    }
                                }
                                else {
                                    $scope.selectedNodes = [];
                                    $scope.resetNodes();
                                }
                            }
                        }
                        if (typeof $scope.wrap !== 'undefined' && $scope.wrap == true) {
                            var mid = node.ColumnId + '.' + node.Id;
                            angular.forEach($scope.data, function (columnItem) {
                                angular.forEach(columnItem.Items, function (rowItem) {
                                    if ((node.ColumnId + '.' + node.Id) == (rowItem.ColumnId + '.' + rowItem.Id)) {
                                        rowItem.active = true;
                                        if (typeof $scope.config !== 'undefined' && typeof $scope.config.nodeContextClickCallback !== 'undefined' && typeof $scope.config.nodeContextClickCallback === 'function') {
                                            $scope.config.nodeContextClickCallback({ 'row': node });
                                            return;
                                        }
                                    }
                                    else
                                        rowItem.active = false;
                                });
                            });
                        }
                    }



                    $scope.findPathsIntersections = function (nodeFrom, nodeToFind, linkings) {
                        var nodeId = nodeFrom.ColumnId + '.' + nodeFrom.Id;
                        var relations = _.filter(linkings, function (link) {
                            return link.fromNode.localeCompare(nodeId) == 0 && link.typeIsForward == true
                        });
                        var res = false;
                        _.each(relations, function (relation) {
                            var result = $scope.markIfPathFound(relation, nodeToFind, linkings);
                            if (result == true) {
                                res = res || true;
                                $scope.markPath(relation.fromNode, relation.toNode, true);
                            }
                            else {
                                res = res || false;
                            }
                        });
                        return res;
                    }

                    $scope.markIfPathFound = function (relation, nodeToFind, linkings) {
                        var mark = false;
                        if (relation.toNode <= (nodeToFind.ColumnId + '.' + nodeToFind.Id)) {
                            angular.forEach($scope.data, function (columnItem) {
                                angular.forEach(columnItem.Items, function (rowItem) {
                                    var rid = rowItem.ColumnId + '.' + rowItem.Id;
                                    if (rid.localeCompare(relation.toNode) == 0) {
                                        if (rowItem.ColumnId.localeCompare(nodeToFind.ColumnId) == 0 && rowItem.Id.localeCompare(nodeToFind.Id) == 0)
                                            mark = true;
                                        else
                                            mark = $scope.findPathsIntersections(rowItem, nodeToFind, linkings);
                                    }
                                });
                            });
                        }
                        return mark;
                    }

                    $scope.pushNode = function (node) {
                        var nid = node.ColumnId + '.' + node.Id;
                        if (_.filter($scope.selectedNodes, function (n) { return nid.localeCompare(n.ColumnId + '.' + n.Id) == 0 }).length == 0)
                            $scope.selectedNodes.push(node);
                    };

                    $scope.openBottomPane = function (node) {
                        $broadcastFactory.broadcastEvent('ng-activegraph-preview-row-open', { 'row': node }, true);
                        $scope.markSingleNodeOnlyActive(node.ColumnId + '.' + node.Id);
                        if (typeof $scope.config !== 'undefined' && typeof $scope.config.nodeContextMenuCallback !== 'undefined' && typeof $scope.config.nodeContextMenuCallback === 'function') {
                            $scope.config.nodeContextMenuCallback({ 'row': node });
                            return;
                        }
                        if ($scope.bottomSidePane.visible == false) {
                            $scope.bottomSidePane.visible = true;
                            $scope.bottomSidePane.paneNode = node;
                        }
                        else {
                            if ((node.ColumnId + '.' + node.Id).localeCompare($scope.bottomSidePane.paneNode.ColumnId + '.' + $scope.bottomSidePane.paneNode.Id) != 0)
                                $scope.bottomSidePane.paneNode = node;
                            else {
                                $scope.bottomSidePane.visible = false;
                                $scope.bottomSidePane.paneNode = null;
                            }
                        }
                        if ($scope.bottomSidePane.visible == false) {
                            $rootScope.reInit();
                        }
                    }

                    $timeout(function () {
                        var width = (($scope.data.length - 1) * 420) + 300;
                        if (typeof $scope.wrap === 'undefined' || $scope.wrap == false)
                            $(".svg-holder").width(width);
                        angular.forEach($element.find('.scenarioCol'), function (ele) {
                            var h = $(ele).height();
                            if ($(window).height() - $(ele).height() - $(ele).offset().top > 0) {
                                //$(ele).css({ 'padding-top': ($(window).height() - $(ele).height() - $(ele).offset().top) * 0.5 });
                            }
                        });
                        $('.containeroverlay').hide();
                        $('.column-container').css('visibility', 'visible');
                    })
                };
                return link;
            },

            templateUrl: "templates/active-graph/scenario.tmpl.html"
        }
    };

    function drawLines(data) {
        var lineArray = [];
        var columnLen = data.length;
        angular.forEach(data, function (value, key) {
            angular.forEach(value.Items, function (v1, k) {
                var offset1 = $("#" + v1.ColumnId + '-' + v1.Id + "-right").offsetRelative("div.item-parent");
                angular.forEach(v1.Links, function (d, i) {
                    var line = {};
                    var id = d.split(".")[1];
                    var offset2 = $("#" + d.split(".")[0] + '-' + id + "-left").offsetRelative("div.item-parent");
                    line.x1 = offset1.left + 8;
                    line.y1 = offset1.top + 8;
                    line.x2 = offset2.left + 8;
                    line.y2 = offset2.top + 8;
                    line.active = false;
                    line.inactive = false;
                    line.Id = "line-" + v1.ColumnId + '.' + v1.Id + d;
                    line.rId = "line-" + d + v1.ColumnId + '.' + v1.Id;
                    line.marked = false;
                    lineArray.push(line);
                });
            });
        });

        return lineArray;
    }

    angular
        .module("ngActiveGraph")

        .directive("ngActivegraphPreview", ["$window", "$timeout", "$rootScope", "ActiveGraph.factories.eventBroadcast.factory", directive]);


    (function ($) {
        $.fn.offsetRelative = function (top) {
            var $this = $(this);
            var $parent = $this.offsetParent();
            var offset = $this.position();
            if (!top) return offset; // Didn't pass a 'top' element 
            else if ($parent.get(0).tagName == "BODY") return offset; // Reached top of document
            else if ($(top, $parent).length) return offset; // Parent element contains the 'top' element we want the offset to be relative to 
            else if ($parent[0] == $(top)[0]) return offset; // Reached the 'top' element we want the offset to be relative to 
            else {// Get parent's relative offset
                var parent_offset = $parent.offsetRelative(top);
                offset.top += parent_offset.top;
                offset.left += parent_offset.left;
                return offset;
            }
        };
        $.fn.positionRelative = function (top) {
            return $(this).offsetRelative(top);
        };
    }(jQuery));

})();

